import React from 'react';

import Card from '../UI/Card';
import classes from './DataList.module.css';

const DataList = props => {
    return (
    <Card className={classes.datas}>
        {/* <ul>
            {props.datas.map(data => 
                <li key={data.id}>
                    {data.subject}
                    {data.grade}
                    {data.credit}
                </li>
            )}
        </ul> */}
        <div>
            {props.datas.map(data => 
                <div key={data.id}>
                <div>{data.subject}</div>
                <div>{data.grade}</div>
                <div>{data.credit}</div>
                </div>
            )}
        </div>
    </Card>

    )
};

export default DataList
